apiVersion: v1
kind: ConfigMap
metadata:
  name: {{ include "confluence.fullname" .Subcharts.confluence }}-server-config
  labels:
  {{- include "umbrella.labels" . | nindent 4 }}
data:
  restore-db.sh: |-
    #! /bin/bash -xe
    until timeout 1 bash -c 'cat < /dev/null > /dev/tcp/{{ include "umbrella.databaseHost" . }}/{{ include "umbrella.databasePort" . }}'; do echo "WAITING: db host {{ include "umbrella.databaseHost" . }} port {{ include "umbrella.databasePort" . }}"; sleep 1; done
    psql -h {{ include "umbrella.databaseHost" . }} -p {{ include "umbrella.databasePort" . }} -U {{ include "umbrella.databaseUser" . }} -d {{ include "umbrella.databaseName" . }} -c 'SELECT 1 FROM cwd_user' && exit 0
    psql -h {{ include "umbrella.databaseHost" . }} -p {{ include "umbrella.databasePort" . }} -U {{ include "umbrella.databaseUser" . }} -d {{ include "umbrella.databaseName" . }} < /tmp/db.dump
    echo "Import dump part 2"
    psql -h {{ include "umbrella.databaseHost" . }} -p {{ include "umbrella.databasePort" . }} -U {{ include "umbrella.databaseUser" . }} -d {{ include "umbrella.databaseName" . }} < /tmp/db.dump2
    unset PGPASSWORD

  confluence.cfg.xml: |-
    <?xml version="1.0" encoding="UTF-8"?>

    <confluence-configuration>
      <setupStep>complete</setupStep>
      <setupType>custom</setupType>
      <buildNumber>8703</buildNumber>
      <properties>
        <property name="access.mode">READ_WRITE</property>
        <property name="admin.ui.allow.daily.backup.custom.location">false</property>
        <property name="admin.ui.allow.manual.backup.download">false</property>
        <property name="admin.ui.allow.site.support.email">false</property>
        <property name="atlassian.license.message">{{ include "umbrella.licenseKey" . }}</property>
        <property name="attachments.dir">${confluenceHome}/attachments</property>
        <property name="confluence.database.connection.type">database-type-standard</property>
        <property name="confluence.setup.server.id">{{ include "umbrella.serverId" . }}</property>
        <property name="confluence.webapp.context.path"></property>
        <property name="hibernate.c3p0.acquire_increment">1</property>
        <property name="hibernate.c3p0.idle_test_period">100</property>
        <property name="hibernate.c3p0.max_size">60</property>
        <property name="hibernate.c3p0.max_statements">0</property>
        <property name="hibernate.c3p0.min_size">20</property>
        <property name="hibernate.c3p0.preferredTestQuery">select 1</property>
        <property name="hibernate.c3p0.timeout">30</property>
        <property name="hibernate.connection.driver_class">org.postgresql.Driver</property>
        <property name="hibernate.connection.isolation">2</property>
        <property name="hibernate.connection.url">jdbc:postgresql://{{ include "umbrella.databaseHost" . }}:{{ include "umbrella.databasePort" . }}/{{ include "umbrella.databaseName" . }}</property>
        <property name="hibernate.connection.username">{{ include "umbrella.databaseUser" . }}</property>
        <property name="hibernate.connection.password">{{ include "umbrella.databasePassword" . }}</property>
        <property name="hibernate.database.lower_non_ascii_supported">true</property>
        <property name="hibernate.dialect">com.atlassian.confluence.impl.hibernate.dialect.PostgreSQLDialect</property>
        <property name="hibernate.setup">true</property>
        <property name="jwt.private.key"></property>
        <property name="jwt.public.key"></property>
        <property name="lucene.index.dir">${localHome}/index</property>
        <property name="synchrony.encryption.disabled">true</property>
        <property name="synchrony.proxy.enabled">true</property>
        <property name="webwork.multipart.saveDir">${localHome}/temp</property>
      </properties>
    </confluence-configuration>

---
